import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet, View} from 'react-native';
import CardSection2 from './components/card_section2';
import CardSection3 from './components/card_section3';
import Header from './components/headerV';
import LineChartV from './components/LineChart';
import NavbarV from './components/Navbar';
import SmallCardLayout from './components/SmallCardLayout';
import TimeLineV from './components/timelineV';

const tinyLineChartData=
[
  {
    "name": "Page A", "uv": 4000, "pv": 2400, "amt": 2400
  },
  {
    "name": "Page B", "uv": 3000, "pv": 1398, "amt": 2210
  },
  {
    "name": "Page C", "uv": 2000, "pv": 9800, "amt": 2290
  },
  {
    "name": "Page D", "uv": 2780, "pv": 3908, "amt": 2000
  },
  {
    "name": "Page E", "uv": 1890, "pv": 4800, "amt": 2181
  },
  {
    "name": "Page F", "uv": 2390, "pv": 3800, "amt": 2500
  },
  {
    "name": "Page G", "uv": 3490, "pv": 4300, "amt": 2100
  }
]


export type dashBoardProps= {
  lineChartData:any

}


const Mystyle={
  backgroundColor:{
    backgroundColor:'#eee'
  },
  chartstyle:{
    backgroundColor:'white',

    marginLeft:'65px',
    borderRadius:'5px',
    padding:'10px',

  },
  timeline :{
    borderRadius:'5px'
  },
  containerPos:{
    marginLeft:"-45px"
  }
}


function DashboardV(props: dashBoardProps) {
  return (
    <View style={StyleSheet.flatten([Mystyle.backgroundColor])}>
      <Header/>

      <Grid container  >
        <Grid item xs={12} sm={9} md={1}>
        <Grid item xs={12} sm={9} md={3} >
        <NavbarV/>
        </Grid>
        </Grid>
        <Grid item xs={12} sm={9} md={11} style={StyleSheet.flatten([Mystyle.containerPos])} >
        <Grid container  >
        <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.backgroundColor])}>
        <SmallCardLayout
        tinyLineChartData={tinyLineChartData}/>
      </Grid>
      <Grid container style={{marginLeft:"40px"}}>
      <Grid  item xs={11} sm={9} md={3} style={StyleSheet.flatten([Mystyle.timeline])}>
      <TimeLineV/>

      </Grid>
        <Grid item xs={11} sm={9} md={8} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV
      lineChartData={props.lineChartData}
      />
      </Grid>
      </Grid>
      <Grid item xs={12} sm={9} md={8} >

      <CardSection2/>
      </Grid>

    <Grid item xs={12} sm={9} md={12}>
      <CardSection3/>
    </Grid>

     </Grid>

      </Grid>
          </Grid>
</View>
  );
}
export default DashboardV;
